// https://leetcode.com/problems/longest-ideal-subsequence/description

#include <iostream>
#include <vector>
#include <cmath>

using namespace std;

class Solution {
public:
    int longestIdealString(string s, int k) {
        int CHAR_OFFSET = 97;
        int CHARS = 26;
        vector<int> char_score(CHARS, 0);
        for (int i=0; i<s.length(); i++) {
            char cur_char = s[i];
            int char_index = int(cur_char) - CHAR_OFFSET;
            int cur_best_score = 0;
            for (int j=0;j<CHARS;j++) {
                char j_char = j + CHAR_OFFSET;
                int dist = abs(cur_char-j_char);
                if (dist <= k) {
                    int new_score = char_score[j] + 1;
                    if (new_score > cur_best_score) {
                        cur_best_score = new_score;
                    }
                }
            }
            char_score[char_index] = cur_best_score;             
        }
        int score_res = 0;
        for (int i=0; i<CHARS; i++) {
            int score = char_score[i];
            if (score > score_res) {
                score_res = score;
            }
        }
        return score_res;
    }
};

int main()
{
    Solution *s = new Solution();

    // Example 1
    // string ss = "acfgbd";
    // int k = 2;

    // Example 2
    string ss = "";
    int k = 8;

    int res = s->longestIdealString(ss, k);

    cout << "res: " << res << endl;
    return 0;
}
